import React from 'react';
import { link } from 'react-router-dom';

const App = () => {
	return (
		<nav
			style={{
				borderBottom: 'solid 1px',
				paddingBottom: '1rem',
			}}
		>
			<Link to="/user">Users</Link>
			<Link to="/expert">Expert</Link>
		</nav>
	);
};

export default App;
